pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

//import "./wallet.sol";
import "../node_modules/@openzeppelin//contracts/access/Ownable.sol";



contract DexSort  {


    //uint id = 0;
    enum Side {
        BUY,
        SELL
    }


    struct Order {

        address trader;
        string ticker;
        uint256 amount;
        Side side;
        uint id;
        uint price;
        bool filled;
    }

    
    //need double mapping to map a token to a buy/sell LimitOrderBook[ticker][uint(side)]
    mapping(string => mapping(uint => Order[])) LimitOrderBook;
    

    function sortOrder(Side side, string memory ticker, int low, int high) public {
     // side = Side.BUY;
      if (low < high) {

        //define arbritarty pivot i just use the last array element
        int pivot = int(LimitOrderBook[ticker][uint(side)][uint(high)].price);
        int i = (low-1); // index of smaller element
        for (int j = low; j < high; j++) {
          //important to convert pivot int. 
          if (int(LimitOrderBook[ticker][uint(side)][uint(j)].price) <= pivot) {
            i++;
           //Note that the code does not swap the integers passed immediately, but first checks if their 
           //addresses are distinct. This is because, if the addresses are equal, the algorithm will fold to a 
           //triple *x ^= *x resulting in zero.
            if (i != j) {
              //i and j or i+1 and high might be the same address in the array. 
              //we need to avoid avoid that edge case we acn use the ^= operator:
              LimitOrderBook[ticker][uint(side)][uint(i)].price ^= LimitOrderBook[ticker][uint(side)][uint(j)].price;
              LimitOrderBook[ticker][uint(side)][uint(j)].price ^= LimitOrderBook[ticker][uint(side)][uint(i)].price;
              LimitOrderBook[ticker][uint(side)][uint(i)].price ^= LimitOrderBook[ticker][uint(side)][uint(j)].price;
            }
          }
        }
        if (i+1 != high) {
          //we do the same checks here again to make sure i + 1 is 
         //is not the same address
          LimitOrderBook[ticker][uint(side)][uint(i+1)].price ^= LimitOrderBook[ticker][uint(side)][uint(high)].price;
          LimitOrderBook[ticker][uint(side)][uint(high)].price ^= LimitOrderBook[ticker][uint(side)][uint(i+1)].price;
          LimitOrderBook[ticker][uint(side)][uint(i+1)].price ^= LimitOrderBook[ticker][uint(side)][uint(high)].price;
        }

        //update pivot
        pivot = i + 1;
        //Much like quicksort we now do a recursive call which calls soet again
        //and sorts our list until base case when the list in finished being sorted
        sortOrder(side, ticker, low, pivot-1);
        sortOrder(side, ticker, pivot+1, high);
      
      }
    //   } else {
    //       if (low < high) {
    //         int pivot = int(LimitOrderBook[ticker][uint(side)][uint(high)].price);
    //         int i = (low-1); // index of smaller element
    //         for (int j = low; j < high; j++) {
    //           if (int(LimitOrderBook[ticker][uint(side)][uint(j)].price) >= pivot) {
    //             i++;
    //             if (i != j) {
    //               LimitOrderBook[ticker][uint(side)][uint(i)].price ^= LimitOrderBook[ticker][uint(side)][uint(j)].price;
    //               LimitOrderBook[ticker][uint(side)][uint(j)].price ^= LimitOrderBook[ticker][uint(side)][uint(i)].price;
    //               LimitOrderBook[ticker][uint(side)][uint(i)].price ^= LimitOrderBook[ticker][uint(side)][uint(j)].price;
    //             }
    //           }
    //         }
    //         if (i+1 != high) {
    //           LimitOrderBook[ticker][uint(side)][uint(i+1)].price ^= LimitOrderBook[ticker][uint(side)][uint(high)].price;
    //           LimitOrderBook[ticker][uint(side)][uint(high)].price ^= LimitOrderBook[ticker][uint(side)][uint(i+1)].price;
    //           LimitOrderBook[ticker][uint(side)][uint(i+1)].price ^= LimitOrderBook[ticker][uint(side)][uint(high)].price;
    //         }
    //         pivot = i + 1;
    //         sortOrder(side, ticker, low, pivot-1);
    //         sortOrder(side, ticker, pivot+1, high);



    //   }
      
      
    }
}
